import { NO_PROJECT } from "../data/data";


const SelectProject = props => {
    return (<div class="input-group mb-3">
                    <div class="input-group-prepend">
                        <label class="input-group-text" for="inputGroupSelect01">Project</label>
                    </div>
                    <select class="custom-select" id="inputGroupSelect01">
                        { Object.keys(props.pr).map((project,idx) =>
                                ((project != NO_PROJECT) ? 
                                <button type="button" className="btn btn-light" onClick={() => setToRender([project])}>
                                    {project}
                                </button>: "")
                        )}
                        <option selected>{NO_PROJECT}</option>
                        <option value="1">One</option>
                        <option value="2">Two</option>
                        <option value="3">Three</option>
                    </select>
                </div>
    )
}

export default SelectProject;
